Resumo_Area_Pesquisa:
Tem experiência nas áreas de Biologia do Desenvolvimento, Genética Molecular e Biologia Tumoral, Hemofilia, Terapia Celular e Células-Tronco, atuando nos seguintes temas:

(1) Câncer: sendo o interesse principal tumores pediátricos meduloblastoma e leucemia mieloide aguda visando compreender mecanismos reguladores pós-transcricionais dos genes HOX com o objetivo de identificar novos alvos terapêuticos anti-tumorais;

(2) Doenças do erro inato do metabolismo de disfunção lisossomal, como doença de Gaucher, Pompe, Fabry sendo o interesse principal as análises genotípica e fenotípica para compreender a associação entre gene modificadores e características clínicas, bem como, as alterações herdadas que sirvam como prognóstico e alvos terapêuticos;

(3) Biotecnologia: sendo o interesse principal utilizar a engenharia genética e a biologia sintética para o desenvolvimento de biofármacos para Terapia de Reposição em Hemofilia A, Hemofilia B e Doença de Gaucher utilizando linhagens celulares humanas e modelos murinos para investigar a funcionalidade in vitro e in vivo desses biofármacos.
